import React, { Component } from 'react'
import Navbarmenu from "./Navbarmenu"


export default class Home extends Component {
    render() {
        return (
            <section style={Pagestyle}>
                <Navbarmenu />
                <div className="container-fluid">
                    <div className="row">
                    <h1 className="bg-light">hello</h1>
                    </div>
                </div>
            </section>
        )
    }
}
const Pagestyle = {
    background:"#000",
    height:"100vh"
}
